import React, {useEffect, useState} from "react"
import {useParams} from "react-router-dom"
import {IBlog} from "../interfaces/blog.interface"
import {useGetProfileMediaQuery} from "../services/instagram.api"

export default function BlogDetailPage() {
    const params: any = useParams()

    const  {isLoading, error, data: blogs} = useGetProfileMediaQuery("")
    const [blog, setBlogs] = useState<IBlog | null>(null)

    if (isLoading) {
        return <p className="text-center">Loading...</p>
    }

    return (
        <div className="container mx-auto max-w-[760px] pt-5">
            <h1 className="text-center text-2xl">{blog?.caption}</h1>

            <p>{params.id}</p>
            <p>{params.caption}</p>
        </div>
    )
}
